import React,{ useEffect, useState } from 'react';
import Axios from 'axios' ;
import './Fachartikel.css';
import {Link} from 'react-router-dom';


function Fachartikel (){
    const [wirkstoffeList, setWirkstoffeList] = useState([]);

    useEffect(()=>{
        Axios.get("http://localhost:3001/api/lese").then((response)=>{
            setWirkstoffeList(response.data)
        }); 
      },[]);


    return (
       <section className="GesamtList">
           {wirkstoffeList.map((val)=>{
            return ( <section>

                    <h1 className="StoffName"> {val.wirkstoffName}</h1> <section className="EinzelStoff">
                    <p className="element"> Beschreibung: </p>
                    <p className="beschreibung"> {val.beschreibung} </p>
                    <hr className="Seperator" />
                    <p className="element"> Struktur und Eigenschaften: </p>
                    <p className="beschreibung"> {val.strukturEigenschaften} </p>
                    <hr className="Seperator" />
                    <p className="element"> Struktur: </p>
                    <p className="beschreibung"> {val.strukturBild} </p>
                    <hr className="Seperator" />
                    <p className="element"> Synonyme: </p>
                    <p className="beschreibung"> {val.synonme} </p>
                    <hr className="Seperator" />
                    <p className="element"> Gruppe: </p>
                    <p className="beschreibung"> {val.gruppe} </p>
                    <hr className="Seperator" />
                    <p className="element"> Wirkung: </p>
                    <p className="beschreibung"> {val.wirkung} </p>
                    <hr className="Seperator" />
                    <p className="element"> Litratur: </p>
                    <p className="beschreibung"> {val.literatur} </p>
                    <hr className="Seperator" />
                    <p className="element"> Molekulargewicht </p>
                    <p className="beschreibung"> {val.molekularerGewicht} </p>
                    <hr className="Seperator" />
                    <p className="element"> Molekulargestalt </p>
                    <p className="beschreibung"> {val.molekularerGestalt} </p>
                    <hr className="Seperator" />
                    <p className="element"> Molekulargöße </p>
                    <p className="beschreibung"> {val.molekularerGroesse} </p>
                    <hr className="Seperator" />
                    </section> 

                      </section>);

            })
            }; </section> );
        }
export default Fachartikel;
